import java.util.Arrays;

public class DescendingOrder {
    public static void main(String[] args) {
        int number = 583209;
        int result = descendingOrder(number);
        System.out.println(result);
    }

    public static int descendingOrder(int num) {
        // Convert the number to a char array
        char[] digits = String.valueOf(num).toCharArray();

        // Sort the array in descending order
        Arrays.sort(digits);
        StringBuilder result = new StringBuilder(new String(digits));
        result.reverse();

        // Convert the result back to an integer
        return Integer.parseInt(result.toString());
    }
}

public class HighLowNumbers {
    public static void main(String[] args) {
        String numbersString = "4 5 29 54 4 0 -214 542 -64 1 -3 6 -6";
        String result = findHighAndLow(numbersString);
        System.out.println(result);
    }

    public static String findHighAndLow(String numbersString) {
        String[] numbersArray = numbersString.split(" ");

        int[] numbers = new int[numbersArray.length];
        for (int i = 0; i < numbersArray.length; i++) {
            numbers[i] = Integer.parseInt(numbersArray[i]);
        }

        int max = Arrays.stream(numbers).max().getAsInt();
        int min = Arrays.stream(numbers).min().getAsInt();

        return "Max: " + max + ", Min: " + min;
    }
}

